    @GetMapping("/xml")
    public void xml(@RequestParam("name") String name, HttpServletResponse response) throws Exception {

//        FileInputStream fileInputStream = new FileInputStream(file);
        InputStream fileInputStream = xml();
        if (!"1".equals(name)) {
            String path = "/Volumes/Work/work/gratone/code/seeing/report/src/main/resources/jasper/" + name + ".jrxml";
            File file = new File(path);
            fileInputStream = new FileInputStream(file);
        }
        JacksonXmlModule module = new JacksonXmlModule();
        XmlMapper mapper = new XmlMapper(module);
        XmlDto xmlDto = mapper.readValue(fileInputStream, XmlDto.class);
        Map<String, Object> objectMap = new HashMap<>();
        Random random = new Random();
        if (xmlDto != null && xmlDto.getParameter() != null && xmlDto.getParameter().size() > 0) {
            xmlDto.getParameter().stream().forEach(vo -> {
                switch (vo.getClassStr()) {
                    case "java.lang.String":
                        if (vo.getName().equals("signature")) {
//                            objectMap.put(vo.getName(), "data:image/jpeg;base64,");
                            objectMap.put(vo.getName(), "https://www.best-seeing.com/public/img/logo.3f4d4a62.png");
                        } else if (vo.getName().contains("image") || vo.getName().contains("img")) {
                            objectMap.put(vo.getName(), "https://www.best-seeing.com/public/img/logo.3f4d4a62.png");
                        } else {
                            objectMap.put(vo.getName(), getStr(random.nextInt(10)));
                        }
                        break;
                    case "java.lang.Long":
                        objectMap.put(vo.getName(), random.nextLong());
                        break;
                    case "java.lang.Boolean":
                        objectMap.put(vo.getName(), random.nextBoolean());
                        break;

                    case "java.lang.Double":
                        objectMap.put(vo.getName(), random.nextDouble());
                        break;
                    case "java.lang.Float":
                        objectMap.put(vo.getName(), random.nextFloat());
                        break;

                    case "java.lang.Integer":
                        objectMap.put(vo.getName(), random.nextInt());
                        break;
                    case "java.lang.Short":
                        objectMap.put(vo.getName(), random.nextInt(100));
                        break;

                    case "java.math.BigDecimal":
                        objectMap.put(vo.getName(), random.nextDouble());
                        break;

                    case "java.sql.Date":
                    case "java.util.Date":
                        objectMap.put(vo.getName(), new Date());
                        break;

                    case "java.sql.Time":
                        objectMap.put(vo.getName(), DateUtil.format(new Date(), DateUtil.TIME_PATTERN));
                        break;
                    case "java.sql.Timestamp":
                        objectMap.put(vo.getName(), DateUtil.getNow());
                        break;
                    default:
                        objectMap.put(vo.getName(), "未知类型");
                        break;
                }
            });
        }
        List<Map<String, Object>> list = new ArrayList<>();
        if (xmlDto != null && xmlDto.getField() != null && xmlDto.getField().size() > 0) {
            Map<String, Object> map = new HashMap<>();
            xmlDto.getField().stream().forEach(vo -> {
                switch (vo.getClassStr()) {
                    case "java.lang.String":
                        if (vo.getName().contains("image") || vo.getName().contains("img")) {
                            map.put(vo.getName(), "https://www.best-seeing.com/public/img/logo.3f4d4a62.png");
                        } else {
                            map.put(vo.getName(), getStr(random.nextInt(10)));
                        }
                        break;
                    case "java.lang.Long":
                        map.put(vo.getName(), random.nextLong());
                        break;
                    case "java.lang.Boolean":
                        map.put(vo.getName(), random.nextBoolean());
                        break;

                    case "java.lang.Double":
                        map.put(vo.getName(), random.nextDouble());
                        break;
                    case "java.lang.Float":
                        map.put(vo.getName(), random.nextFloat());
                        break;

                    case "java.lang.Integer":
                        map.put(vo.getName(), random.nextInt());
                        break;
                    case "java.lang.Short":
                        map.put(vo.getName(), random.nextInt(100));
                        break;

                    case "java.math.BigDecimal":
                        map.put(vo.getName(), random.nextDouble());
                        break;

                    case "java.sql.Date":
                    case "java.util.Date":
                        map.put(vo.getName(), new Date());
                        break;

                    case "java.sql.Time":
                        map.put(vo.getName(), DateUtil.format(new Date(), DateUtil.TIME_PATTERN));
                        break;
                    case "java.sql.Timestamp":
                        map.put(vo.getName(), DateUtil.getNow());
                        break;
                    default:
                        map.put(vo.getName(), "未知类型");
                        break;
                }
                log.info("name:{}", vo.getName());

            });
            list.add(map);
        }
        log.info("{}", objectMapper.writeValueAsString(objectMap));
        log.info("{}", objectMapper.writeValueAsString(list));
        InputStream fileInputStream1 = xml();
        if (!"1".equals(name)) {
            String path = "/Volumes/Work/work/gratone/code/seeing/report/src/main/resources/jasper/" + name + ".jrxml";
            File file1 = new File(path);
            fileInputStream1 = new FileInputStream(file1);
        }
        JasperDesign jdesign = JRXmlLoader.load(fileInputStream1);
        ReportExportUtil.exportHtmlWithImages(jdesign, objectMap, list, response);
    }

    private String getStr(int num) {
        if (num < 1) {
            num = 1;
        }
        StringBuffer charValue = new StringBuffer();
        String str = "杭州贯通云科技有限公司";
        Random random = new Random();
        for (int i = 0; i < num; i++) {
            int number = random.nextInt(10);
            charValue.append(str.charAt(number));
        }
        return charValue.toString();
    }


